import React from 'react';

function Login() {
  return(
    <div>
    <form>
       <label>
         CODE:
         <input type="text" />
       </label>
       <label>
         PIN:
         <input type="text" />
       </label>
       <input type="submit" value="Submit" />

     </form>
     </div>
  );
}

export default Login;
